import React from 'react';

export default function Contact(){
  return (
    <div className="container mx-auto px-4 py-12">
      <h1 className="text-3xl font-extrabold mb-4">தொடர்பு</h1>
      <p className="text-gray-700">தொடர்பிற்கான மின்னஞ்சல்: <a className="text-primary" href="mailto:eazhisaie@gmail.com">eazhisaie@gmail.com</a></p>
      <p className="mt-2">தொலைபேசி: <a className="text-primary" href="tel:+94705738946">+94 70 5 738946</a></p>
    </div>
  );
}
